def divisibility_strings(plan_config: str, display_str: str):
    if display_str not in plan_config:
        return -1
    times = 1
    found = False
    while not found:
        test_string = times * display_str
        if test_string == plan_config:
            found = True
            break
        times += 1

    curr_str = ""
    for char in display_str:
        curr_str += char
        if curr_str * 2 in plan_config:
            return len(curr_str)


s = ""
t = ""
s2 = "bcdbcdbcdbcd"
t2 = "bcdbcd"
s3 = "asdfasdfasdfasdf"
t3 = "bcd"

print(divisibility_strings(s, t))  # 194
print(divisibility_strings(s2, t2))  # 3
print(divisibility_strings(s3, t3))  # -1
